import React, { Component } from 'react';
import './CameraView.css';

class CameraView extends Component {
    render() {
        return (
            <div className="cameraView">
                <h2>Camera From the Boat</h2>    
                <p>Not Availble Yet!</p>
            </div>
        );
    }
}

export default CameraView;
